const Notification = ({ names, items, times }) => {
    const rendered_items = items.map((item, key) => {
        return (
            <div>
                <p>
                    {names[key]} {item}
                    <br></br>
                    { times[key] }
                </p>
            </div>
        )
    })

    return (
        <div>{ rendered_items }</div>
    )
}

export default Notification;
